import { useState } from 'react'
import CustomForm from '../styles/CustomForm.module.css'
import style from '../styles/Home.module.css'
const videos = [
	{
		name: 'Назва відео 1',
		duration: 15,
		id: 1,
	},
]

export function Home() {
	const [count, setCount] = useState(0)
	return (
		<>
			<aside>sad</aside>
			<main>
				<div className={style.Search}>
					<form action=''>
						<input type='text' className={CustomForm.CustomInput} />
					</form>
				</div>
				{videos.map(video => {
					return (
						<div key={video.id}>
							<img alt='' />
							<p>{video.name}</p>
							<p>{video.duration}</p>
							<button onClick={() => setCount(count => count + 1)}>
								button
							</button>
							<p>{count}</p>
						</div>
					)
				})}
			</main>
		</>
	)
}
